import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
  background-color: ghostwhite;
  padding: 300px;
`;

const LeftContent = styled.div`
  flex: 1;
`;

const RightContent = styled.div`
  flex: 1;
  text-align: right;
`;

const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const Button = styled.button`
  padding: 10px 20px;
  background-color: #007bff; /* 원하는 버튼 배경색으로 변경 */
  color: white;
  border: none;
  cursor: pointer;
  font-size: 16px;
  width: 100%;
`;

const Home = () => {
    return (
        <div>
            <Container>
                <LeftContent>
                    {/* 왼쪽에 동그란 사진 */}
                    <img src="/Users/apple/Documents/GitHub/Muzik_Service/public/favicon.ico" alt="Your Image" style={{ borderRadius: '50%', width: '150px', height: '150px' }} />
                </LeftContent>
                <RightContent>
                    {/* 오른쪽에 글 */}
                    <p>나를 소개할 수 있는 글 내용</p>
                </RightContent>
            </Container>
            <ButtonContainer>
                <Button>버튼 1</Button>
                <Button>버튼 2</Button>
                <Button>버튼 3</Button>
                <Button>버튼 4</Button>
            </ButtonContainer>
        </div>

    )
};

export default Home;
